import React from 'react'

export default function TrackSearchResults({track, chooseTrack, search, setSearch}) {

    function handlePlay(){
        chooseTrack(track)
    }

    return (<div className="header">
    <div className="header__container">
      <label>
        <input
          className="header__container__input"
          type="search"
          placeholder="search"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
        />
      </label>
    </div>

    <div onClick={handlePlay}>
            {track.artist}
            <img src={track.albumUrl} alt="yes" />
            {track.title}
            <img src={track.bigAlbumImage} alt="yes" />
        </div>
  </div>

    )
}
